function FetchData3() {
const [posts,setPosts]=useState({firstname:'',lastname:''})
// const [flag,setFlag]=useState({firstname:'',lastname:'',age:''})
  const [data,setData]=useState()
  const clickHandler=(()=>{
    setData(posts)
  })
    return (
      <div>
        <button onClick={clickHandler}>PrintNames</button>
        <input type='text' name='firstname' value={posts.firstname} onChange={(e)=>{setPosts({[e.target.name]:e.target.value})}} ></input>
        <input type='text' name='lastname' value={posts.lastname} onChange={(e)=>{setPosts(e.target.value)}} ></input>
        <div>{posts.firstname}</div>
        {/* <div>{posts.lastname}</div> */}
        {/* <div>{posts.age}</div> */}
      </div>
    );
  }
  
